import React from 'react';
import { Link } from 'react-router-dom';

const MainMenu = () => {
  return (
    <div style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        backgroundColor: '#333',
        color: 'white',
        width: '100%',  // This ensures the div takes full width
        margin: '0',  // No margin
        padding: '0 20px',  // Padding inside doesn't affect width
        height: '50px'
    }}>
      <ul style={{
          display: 'flex',
          listStyle: 'none',
          width: '100%',  // Ensures ul takes full width
          margin: '0',  // No margin
          padding: '0'  // No padding
      }}>
        {/* List items */}
      </ul>
    </div>
  );
}

export default MainMenu;
